def entance(nums, target):
    pairs = []
    n = len(nums)
    for i in range(n):
        for j in range(i - 1, n):
            if nums[i] + nums[j] == target:
                pair = sorted([nums[i], nums[j]])
                if pair not in pairs:
                    pairs.append(pair)
    count = len(pairs)
    pairs = [tuple(p) for p in pairs]
    return (count, pairs)

